import { useContext, useEffect, useState } from "react";
import { AuthContext } from "../../context";

export default function Homepage() {


  const { userGoogle, userFacebook } = useContext(AuthContext);
  console.log(userGoogle);
  console.log(userFacebook);

  let userFacebookPictureUrl = userFacebook.picture.data.url;
  console.log(userFacebookPictureUrl);

  if (Object.keys(userGoogle).length !== 0) {
    // Utilisateur connecté avec Google
    userPictureUrl = userGoogle.picture;
  } else if (Object.keys(userFacebook).length !== 0) {
    // Utilisateur connecté avec Facebook
    userPictureUrl = userFacebook.picture.data.url;
  }


  return (
    <div className="container">
      <div className="row">
        <h1> Homepage </h1>
      </div>
      {Object.keys(userGoogle).length !== 0 || Object.keys(userFacebook).length  && (
        <>
          <div className="row">
            <div className="col-6 text-end">
              <h2>Bienvenue {userGoogle.name || userFacebook.name}</h2>
            </div>
            <div className="col-6 text-center">
              <img src={`${userGoogle.picture} || ${userFacebookPictureUrl}`}></img>
            </div>
          </div>
          <div className="row">
          <p>Vous êtes connecté avec {Object.keys(userGoogle).length !== 0 ? "votre Compte Google" : "votre Compte Facebook"}</p>
          </div>
        </>
      )}
    </div>
  );
}
